import {selectCurrentUser} from '../../redux/user/user.selectors';
import {ProfileContainer, ProfileHeader, ProfileContent, UserDetail, TextContainer} from './user-profile.styles';

const User = () => {
	const currentUser = useSelector(selectCurrentUser);
	const {first_name, last_name, email_address, street_address, city, state, zip_code, ethereum_address} = currentUser
	console.log(currentUser)
	return (
	<ProfileContainer>
		<ProfileHeader>
			<h1>User Profile</h1>
		</ProfileHeader>
		<ProfileContent>
			<UserDetail>
				<TextContainer><strong>Username:</strong> john_doe</TextContainer>
				<TextContainer><strong>Name:</strong> {first_name} {last_name}</TextContainer>
				<TextContainer><strong>Email:</strong> john.doe@gmail.com</TextContainer>
			</UserDetail>
		</ProfileContent>
	</ProfileContainer>
)};

export default User
